member.remarks:
            A caller calls this method to log geometry value.
            The message is logged in the following format:


            <Date>|<Time>|<PID>|<TID>|[<InstanceID>]|<FileName>|<ProcedureName>|<SubsystemDescription>|<CategoryDescription>|<Variable Name>|<Geometry Properties><MBR Range>{[<X>,<Y>]}

            A caller calls this method to log recordset contents.
            The message is logged in the following format:


            <Date>|<Time>|<PID>|<TID>|[<InstanceID>]|<FileName>|<ProcedureName>|<SubsystemDescription>|<CategoryDescription>|<Variable Name>|<FieldNames>{[<FieldValues>]}

            For internal use only.  A caller calls this method to log GDO recordset contents.
            The message is logged in the following format:


            <Date>|<Time>|<PID>|<TID>|[<InstanceID>]|<FileName>|<ProcedureName>|<SubsystemDescription>|<CategoryDescription>|<Variable Name>|<FieldNames>{[<FieldValues>]}
